<p><hi rend="bold">جياڭسۇ ئۆلكىسى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭخۇا_خەلق_جۇمھۇرىيىتى">جۇڭخۇا خەلق جۇمھۇرىيىتى</ref> دىكىبىخاھار 2006 نوپۇس بار، جياڭسۇنىڭ 75،495،000 نوپۇسىبار، 102،600 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 33.0°، خارىكى ئۇزۇنلۇك 120°0.</p>
